import React from 'react'
import './navbar.css'
import SearchIcon from '@mui/icons-material/Search';

const Navbar = () => {
  return (
    <div className='navbar'>
        <div className='wrapper'>
            <div>Dashboard</div>
            <div className='search'>
                <input type="text" placeholder='search' /><SearchIcon/>
            </div>

        </div>

    </div>
  )
}

export default Navbar
